def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    segments = [list(map(int, line.split())) for line in stdin.split('\n')[1:]]

    def is_degenerate(a, b):
        return a == b or a + 1 == b or a - 1 == b

    def intersect(p1: tuple, p2: tuple, q1: tuple, q2: tuple) -> tuple:
        def slope(p, q):
            return (q[1] - p[1]) / (q[0] - p[0])

        def intersect_lines(p1: tuple, p2: tuple, q1: tuple, q2: tuple) -> tuple:
            x1, y1 = p1
            x2, y2 = p2
            x3, y3 = q1
            x4, y4 = q2

            def det(a, b, c, d):
                return a * b + c * d

            def cross(a, b, c, d):
                return a * (b[0] - c[0]) + b * (c[1] - d[1]) + c * d - d * (a[0] - b[0]) - b * (a[1] - c[1]) - c * (a[0] - d[0])

            det1 = det(x1 - x3, y1 - y3, x2 - x3, y2 - y3)
            det2 = det(x1 - x4, y1 - y4, x2 - x4, y2 - y4)

            if det1 == 0 or det2 == 0:
                return None

            det3 = det(x3 - x4, y3 - y4, x1 - x2, y1 - y2)

            if det3 == 0:
                return (x1, y1)

            x5 = det3 / det1
            y5 = cross(det1, x1 - x3, y1 - y3, x4 - x3, y4 - y3) / det1

            if 0 <= x5 <= x2 - x1 and 0 <= y5 <= y2 - y1:
                return (x5, y5)
            else:
                return None

        def intersect_segments(p1: tuple, p2: tuple, q1: tuple, q2: tuple) -> bool:
            if is_degenerate(p1[0], p2[0]) or is_degenerate(q1[0], q2[0]):
                return True

            if abs(p1[1] - p2[1]) < 1e-10:
                return abs(slope(p1, q1) * p1[0] + p1[1]) < 1e-10

            if abs(q1[1] - q2[1]) < 1e-10:
                return abs(slope(q1, p2) * q1[0] + q1[1]) < 1e-10

            if abs(p1[0] - q1[0]) < 1e-10:
                return abs(slope(p1, q1) * p1[1] + p1[0]) < 1e-10

            if abs(q1[0] - p2[0]) < 1e-10:
                return abs(slope(q1, p2) * q1[1] + q1[0]) < 1e-10

            return intersect_lines(p1, p2, q1, q2) is not None

        return intersect_segments(p1, p2, q1, q2)

    def max_length(segments):
        max_length = 0
        for i in range(len(segments)):
            for j in range(i + 1, len(segments)):
                for k in range(j + 1, len(segments)):
                    for l in range(k + 1, len(segments)):
                        if intersect(segments[i], segments[j], segments[k], segments[l]):
                            intersection = intersect(segments[i], segments[j], segments[k], segments[l])
                            length = (intersection[1] - intersection[0]) ** 2 + (intersection[3] - intersection[2]) ** 2
                            max_length = max(max_length, length)
        return max_length

    result = max_length(segments)
    return str(result)

