                s[p[i], q[i]] = s[p[i + 1], q[i + 1]] = s[p[i], q[i]] + 1
                if backtrack(s, p, q):
                    return True
                s[p[i], q[i]] = s[p[i + 1], q[i + 1]] = s[p[i], q[i]] - 1

        return False

    s = ['a' + str(i) for i in range(n)]
