    N, *A = map(int, stdin.split())

    # Build a graph
    graph = [[] for _ in range(N + 1)]
    for i, ai in enumerate(A):
        graph[ai].append(i)

    # BFS to find the number of immediate subordinates
    def bfs(i):
        queue = deque([i])
        visited = set()
        visited.add(i)
        count = 0
        while queue:
            size = len(queue)
            for _ in range(size):
                current = queue.popleft()
                for next in graph[current]:
                    if next not in visited:
                        visited.add(next)
                        queue.append(next)
                        count += 1
        return count

    return '\n'.join(map(str, [bfs(i) for i in range(1, N + 1)]))

