    def is_even(x: int) -> bool:
        return x % 2 == 0

    def is_prime(x: int) -> bool:
        if x <= 1:
            return False
        for i in range(2, int(x**0.5) + 1):
            if x % i == 0:
                return False
        return True

    def is_between(x: int, lower: int, upper: int) -> bool:
        return lower <= x <= upper

    def ask_question(question: str, values: List[str]) -> str:
        return random.choice(values)

    def check_answer(secret_number: int, question: str, value: str) -> bool:
        if question == "Is the number even?":
            return value == "true"
        elif question == "Is the number between $7$ and $10$?":
            lower, upper = 7, 10
            if value == "true":
                return lower <= secret_number <= upper
            else:
                return lower > secret_number or upper < secret_number
        elif question == "Is the number $17$ or $22$?":
            if value == "true":
                return secret_number in [17, 22]
            else:
                return secret_number not in [17, 22]
        elif question == "Is the number prime?":
            return value == "true"

    def play_game(secret_number: int) -> str:
        questions = [
            (1, "Is the number even?"),
            (1, "Is the number between $7$ and $10$?"),
            (1, "Is the number $17$ or $22$?"),
            (1, "Is the number prime?"),
        ]
        for i in range(K):
            if random.randint(1, 3) == 1:
                questions.append((1, f"Is the number {i}?"))
        for i in range(K, N):
            if random.randint(1, 2) == 1:
                questions.append((1, f"Is the number {i}?"))

        answers = []
        for question, values in questions:
            answer = ask_question(question, values)
            answers.append((question, answer))

        correct_answers = sum(check_answer(secret_number, question, answer) for question, answer in answers)
        if correct_answers == N:
            return "Your wish is granted!"
        else:
            return "You will become a flying monkey!"

    secret_number = random.randint(1, N)
    if is_prime(secret_number):
